import Vue from 'vue'
import App from './App.vue'
// 引入vant样式
import 'vant/lib/button/style';
// 引入vant组件
import './styles.scss'
import router from './router'
import Http from './http';
Vue.prototype.$http = Http
Vue.use(ElementUI)

Vue.config.productionTip = false

new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
